/**
 * @see java.lang.Object#hashCode()
 */
@Override
public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + preNode;
  long temp;
  temp = Double.doubleToLongBits(weight);
  result = prime * result + (int) (temp ^ (temp >>> 32));
  return result;
}

